import React, { Component } from 'react';
import { useSearchParams } from 'react-router-dom';
import { SpotifyService } from '../spotify/spotify.service';

class CallBack extends Component {
  state = { artists: [] };
  spotifyService = new SpotifyService();

  async componentDidMount(): Promise<void> {
    const [searchParams] = useSearchParams();
    const userCode = searchParams.get('code');
    if (!userCode) throw Error('no user code');

    const accessToken = await this.spotifyService.getAccessToken(userCode);
    this.setState({ accessToken });
  }
  getAccessToken(userCode: string) {}

  async getTopArtists(accessToken: string) {
    const userProfile = await this.spotifyService.getUserProfile(accessToken);
    this.setState({ artists: userProfile });
  }

  render() {
    return (
      <div>
        <h1>User</h1>
        <p>Code: {this.state.accessToken}</p>
      </div>
    );
  }
}
export default CallBack;
